import React from "react";
import "./styles/Contracts.css";

const ContractData = props => {

  return (
    <React.Fragment>
      <p><b>Name:</b> &#09;<br/> {props.name} </p>
      <p>Start: &#09;<br/> {props.startDate}</p>
      <p>Ende: &#09;<br/>{props.endDate}</p>
      <p>Preis: &#09;<br/>{props.price}</p>
      <p>Beschreibung: &#09;<br/>{props.description}</p>
    </React.Fragment>
  );
};

const Contract = props => (
  <div className="contractBox">
    <ContractData name={props.name} startDate={props.startDate} endDate={props.endDate} price={props.price} description={props.description}></ContractData>
  </div>
);

export default Contract;
